import React, { Component } from "react";

class Navbar extends Component {
  state = {};
  render() {
    return (
      <div styles={{ backgroundColor: "black" }}>
        <button
          style={{ marginLeft: "10px", float: "right" }}
          className="btn btn-outline-secondary"
          type="button"
        >
          Uusi kalenteri
        </button>

        <span
          class="input-group"
          style={{ float: "right" }}
          position="absolute"
        >
          <input
            type="text"
            styles={{ float: "right" }}
            placeholder="Hae Kalenteria"
            aria-label="Hae Kalenteria"
          ></input>
          <div class="input-group-append">
            <button
              class="btn btn-outline-secondary"
              type="button"
              style={{ float: "right" }}
            >
              Hae
            </button>
          </div>
        </span>
      </div>
    );
  }

  getstyles() {
    let styles = "background-color: lightblue";
    return styles;
  }
}

export default Navbar;
